import React from "react";

function footer() {
  return (
    <div>
      <div className="row">
        <div className="col-md-12">
          <div className="footer p-3 mt-4 text-center bg-dark text-light">
           
          </div>
        </div>
      </div>
    </div>
  );
}

export default <div className="row"></div>;
